:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, James Nelson and BEETHAM, Mary-Margaret
  JWILLIAMS, Heathcote Beetham and MYHILL, Mary Anderson (Molly)
  WILLIAMS, Heathcote Beetham and MYHILL, Mary Anderson (Molly) (cont...)
  Co Ltd; Ngarere Goldfields Ltd; and Kerridge Odeon Group of Companies. He established Huiarua Ltd, a family
  farming company which owned "Huiarua" station, "Matanui" station inland from Tokomaru Bay (purchased in 1966
  from the Estate of E P Murphy), Paradise Farm Horticulture near Puha, Gisborne and "Ohinewairoa" station near
  Taihape. He established the Turihaua Angus Stud in 1906 and set up the JN Williams Memorial Trust in 1945 in
  memory of his son, Jack. Mary established the M A Williams Charitable Trust in 1968.
  Turihaua Station
  Located on the coast 16 km north of Gisborne, this property was purchased from the Maoris in 1884 by Alan
  McDonald. Comprising some 5,000 acres, it was mortgaged to the Bank of New Zealand which finally bought it in
  1890. In 1894 it was purchased by James Nelson Williams of "Frimley" much as it is today. He first used it as
  a fattening farm for his Waipiro Bay properties. In 1896 it was offered for sale but, there being no takers,
  it was withdrawn two years later. In 1901 James leased "Turihaua" to his son, Heathcote Beetham Williams snr
  who ran it from Hawkes Bay until 1905 when he came to live on the property. He established the, now famous,
  Turihaua Angus Cattle Herd and also a purebred Romney (unregistered) flock which is still going today. He
  completed felling of some of the Puriri bush still standing in 1905.
  On 14 Sep 1942 HB Williams transferred the property to Trusts for his sons, James Nelson Williams and
  Heathcote Beetham (Bill) Williams. James was killed in the war in 1942 and since then the property has
  belonged, through trusts, to several family members.
  Hamish Beetham Nolan Williams has controlled the station since 1986 and, besides continuing the successful
  operation of the Angus Stud, he has introduced a registered Romney Stud. A deer farm has operated since 1980
  under the control of James Nelson Marcus Williams and a small horticultural block adjoining "Turihaua" was
  purchased in 1987.
  01> WILLIAMS, Janet Mary m on 06.02.1948 to WILLIAMS, Leonard Heathcote (Bill).
  b 16.07.1918 d 28.11.1979
  b 27.05.1912 d 28.11.1979
  Janet b. at Havelock North and m. at Gisborne. Leonard, s/o Francis James Williams and Edith Frances
  Standish, b. at Napier. Jan and Bill were second cousins. Their biographies and descendants are listed
  under Bill's entry in this Family Tree.
  02> WILLIAMS, James Nelson (Jack)
  b 21.02.1921 d 19.12.1943
  Jack b. at Gisborne. He attended Christ's College where he was a school prefect and
  athletics champion in 1939. He became a flying officer in the RNZAF (1940-1943). He was
  killed in action at Rabaul, New Guinea.
  03> WILLIAMS, Heathcote Beetham m on 09.11.1946 to NOLAN, Patricia Elizabeth
  (Bill)
  b 16.08.1922
  b 30.05.1924
  Bill b. and m. at Gisborne. Patricia, d/o Henry Clyde Nolan and Sylvia Mary
  Westenra. Address: Turihaua Station, RD 3, Gisborne.
  Bill was educated at Hereworth School and Christ's College (head prefect, captain
  of 1st XV). He joined the armed forces and spent a year in the Pacific in a Lt
  Anti-Aircraft Unit as a Lieutenant. He returned to farm at "Turihaua" with his
  father and later took over the running of the property. He became involved in
  business and has served as Director of Gisborne Sheepfarmers Mercantile Co Ltd; Gisborne Sheepfarmers
  Freezing Co Ltd; Crown Consolidated; Dalgety Crown; Wanganui Woollen Mills Ltd; Ormond Motors Ltd and JL
  Primrose Ltd. He has also served on the Gisborne Harbour Board for a number of years.
  Bill set up the Turihaua Charitable Trust in 1962 and the Turanga Charitable Trust in 1975. In 1963 he
  bought the Eastwoodhill Arboretum which was given to the Nation in 1975 under a special Act of Parliament.
